import React, { Component } from 'react'
import cart from "../../assets/images/shopping-cart.png";
import api from "../../locals/products.json";
import product1 from "../../assets/images/Frame 27.png";
import product2 from "../../assets/images/Product D.png";
export default class Cart extends Component {


    constructor(props) {
        super(props);
        this.state = {

            products: api.data.products, // Use an array to hold the products
            singleProduct: {}
        };
    }


    render() {
        const { cartElements } = this.props
        console.log(cartElements)




        return (
            <div>

                <button type="button" className="btn position-relative " data-bs-toggle="modal" data-bs-target="#exampleModal">
                    <span className='cartCount'>{cartElements.length}</span>
                    <img src={cart} alt='cart icon' />
                </button>


                <div className="modal fade " id="exampleModal" >
                    <div className="modal-dialog">

                        <div className='modal-content'>
                            <div className='modal-body'>
                                <div className='cartHeading d-flex align-items-center'>
                                    <h4>My Bag, </h4><p className='m-0'>{cartElements.length} items</p>

                                </div>

                                <div className='cartItemsContainer my-2'>

                                    {cartElements.map((cartItem) => (

                                        <div className='cartItem w-100 d-flex' key={cartItem.id}>

                                            <div className='w-50 cartItemContent'>
                                                <h5 className='itemName'>{cartItem.product.name} </h5>
                                                <p className='m-0 itemPrice'>{cartItem.product.prices[0].currency_symbol}{cartItem.product.prices[0].amount}</p>

                                                <div className='productAttr'>



                                                    {
                                                        cartItem.product.attributes.map((attrItem) => {
                                                            let content;
                                                            switch (attrItem.name) {
                                                                case "Color":
                                                                    content = (
                                                                        <div className='productColors'>
                                                                            <p>{attrItem.name}:</p>
                                                                            <div className="d-flex align-items-center w-75 sizesContainer my-2" >
                                                                                {attrItem.items.map((item, index) => (<label className="containerBlock colorItem" style={{ background: item.value }} key={index}>
                                                                                    <input type="radio" name="color" value={item.value} />
                                                                                    <span className="checkmark"></span>
                                                                                </label>))}



                                                                            </div>
                                                                        </div>
                                                                    );
                                                                    break;

                                                                default:
                                                                    content = (
                                                                        <div className="productSizes my-2" >
                                                                            <p>{attrItem.name}:</p>
                                                                            {attrItem.items.map((item, index) => (<label className="containerBlock" key={index}>
                                                                                <input type="radio" name={"size"} value={"xl"} />
                                                                                <span className="checkmark">{item.display_value}</span>
                                                                            </label>))

                                                                            }

                                                                        </div>
                                                                    );
                                                                    break;
                                                            }

                                                            return content;
                                                        })
                                                    }











                                                </div>

                                            </div>
                                            <div className='w-50 d-flex justify-content-between align-items-center '>
                                                <div className='d-flex align-items-center justify-content-between flex-column cartItemquantity'>
                                                    <button>+</button>
                                                    <span>1</span>
                                                    <button>-</button>


                                                </div>
                                                <div className='itemImage'>
                                                    <img src={product1} alt='product image' />

                                                </div>



                                            </div>

                                        </div>


                                    ))}


                                </div>
                                <div className='totalPrice d-flex align-items-center justify-content-between'>

                                    <p className='m-0'>

                                        Total
                                    </p>
                                    <p className='m-0'>

                                        $200.00
                                    </p>


                                </div>
                                <div className='placeOrder '>
                                    <div className='my-4' >
                                        <button className='cartBtn'>PLACE ORDER</button>
                                    </div>

                                </div>

                            </div>

                        </div>
                    </div>
                </div>


            </div>
        )
    }
}
